transformations.javascript:
return data.results.map(page => {
  const props = page.properties;

  // safe extractor for rich_text or title
  const getPlainText = field => {
    if (!props[field]) return "";
    const val = props[field][props[field].type];
    if (!Array.isArray(val) || val.length === 0) return "";
    return val.map(item => item.plain_text).join(" ");
  };

  return {
    id: page.id,
    name: getPlainText("Name"),
    text: getPlainText("Text"),
    text1: getPlainText("Text 1"),
    description: getPlainText("Description"),
    url: page.url
  };
});
